ize><charset>utf-8</charset><passages><passage>Всем <hlword>привет</hlword> - мы недавно вернулись с Соколовой горы, народу много, машину поставить не где, нагулялись пару часов, дети все облазили , вечером фотки выложу.</passage></passages><properties>&lt;_PassagesType&gt;0<!--_PassagesType--></properties><mime-type>text/html</mime-type><saved-copy-url>http://hghltd.yandex.net/yandbtm?isu=1&amp;src=FT&amp;d=6257&amp;fmode=inject&amp;tld=ru&amp;la=&amp;dsn=0&amp;text=%D0%9F%D1%80%D0%B8%D0%B2%D0%B5%D1%82&amp;sh=-1&amp;sg=sas1-1828.search.yandex.net%3A8041&amp;url=http%3A%2F%2F64pokupki.ru%2Fforum%2Findex.php%3FPHPSESSID%3Dcngoiaq6hdk7v6sl35jli4u742%26topic%3D232.54400&amp;mime=html&amp;l10n=ru&amp;sign=b416eaa05d0eba6ec55ad562aab0b274&amp;keyno=0</saved-copy-url></relevance></doc><doc id="Z1E7CC1453D3E9088"><relevance priority="all"><url>http://64pokupki.ru/forum/index.php?PHPSESSID=gnvpett2dpktku69bqvplsg320&amp;topic=232.54400</url><domain>64pokupki.ru</domain><title>Чирик-чирик</title><modtime>20140510T052505</modtime><size>225217</size><charset>utf-8</charset><passages><passage>Всем <hlword>привет</hlword> - мы недавно вернулись с Соколовой горы, народу много, машину поставить не где, нагулялись пару часов, дети все облазили , вечером фотки выложу.</passage></passages><properties>&lt;_PassagesType&gt;0<!--_PassagesType--></properties><mime-type>text/html</mime-type><saved-copy-url>http://hghltd.yandex.net/yandbtm?isu=1&amp;src=FT&amp;d=6257&amp;fmode=inject&amp;tld=ru&amp;la=&amp;dsn=0&amp;text=%D0%9F%D1%80%D0%B8%D0%B2%D0%B5%D1%82&amp;sh=-1&amp;sg=sas1-1828.search.yandex.net%3A8041&amp;url=http%3A%2F%2F64pokupki.ru%2Fforum%2Findex.php%3FPHPSESSID%3Dcngoiaq6hdk7v6sl35jli4u742%26topic%3D232.54400&amp;mime=html&amp;l10n=ru&amp;sign=b416eaa05d0eba6ec55ad562aab0b274&amp;keyno=0</saved-copy-url></relevance></doc></relevance></categ></group></grouping></results></response></yandexsearch>');
      while ($reader->read()) {
        if ($reader->name == 'doc' && $reader->nodeType == XMLReader::ELEMENT ) {
          $reader = $this->smartReader($reader,3);
          $url = $reader->value;
          $res = $this->getPassageText($reader,'title');;
          $reader = $res['reader'];
          $title = $res['text'];
          $reader->read();
          if ($reader->name == 'headline') {
            $reader->read();
            $content = $reader->value;
          }else{
            $res = $this->getPassageText($reader,'passage');
            $content = $res['text'];
          }
          $this->yandexResult[$url] = array('title' => $title,'content' => $content);
        }
        if($reader->name == 'error'){
          $reader->read();
          $this->yandexResult['error'] = array('title' => 'error','content' => $reader->value);
        }
      }
      $reader->close();
    }
  }

  public function getGeneralResult(){
    $this->setGoogleResult();
    $this->setYandexResult();
    $yandex = $this->yandexResult;
    foreach ($this->googleResult as $key => $value) {
      if (isset($yandex[$key])) {
        $this->generalResult['general'][$key] = $value;
        unset($yandex[$key]);
      }else{
        $this->generalResult['google'][$key] = $value;
      }
    }
    $this->generalResult['yandex'] = $yandex;
    return $this->generalResult;
  }

  private function getPassageText($xml,$element){
    $text = '';
    while($xml->read()){
      if ($xml->name == $element && $xml->nodeType == XMLReader::ELEMENT) {
        do {
          $xml->read();
          if ($xml->hasValue) {
            $text .=' '. $xml->value;
          }
        } while ( !($xml->name == $element && $xml->nodeType == XMLReader::END_ELEMENT));
        break;
      }
    }
    return array('text'=>$text,'reader'=>$xml);
  }

  private function smartReader($xml,$count){
    $i = 0; 
    while($i < $count){ 
        $xml->read(); 
        $i++; 
    } 
    return $xml;
  }
